import React, { Fragment } from 'react';
import spinner from './spinner.gif';

const Spinner = () => (
  <Fragment>
    <img
      src={spinner}
      alt='Looding...'
      style={{ with: '100px', margin: 'auto', display: 'block' }}
    />
  </Fragment>
);

export default Spinner;
